CREATE TABLE tokens (
    token_id INT PRIMARY KEY,
    token_name VARCHAR(255),
    token_symbol VARCHAR(50),
    total_supply DECIMAL
);

CREATE TABLE addresses (
    address_id INT PRIMARY KEY,
    address VARCHAR(255),
    owner_name VARCHAR(255),
    balance DECIMAL
);

